<html>
<head>
    <link href="https://fonts.googleapis.com/css2?family=Roboto:ital,wght@0,400;1,300&display=swap" rel="stylesheet">
    <link href="https://fonts.googleapis.com/css2?family=Alata&display=swap" rel="stylesheet">
    <style>
        html {
            background-color: transparent;
            background-image: linear-gradient(to top, #c1dfc4 0%, #deecdd 100%);
            /*text-shadow: 2px 0 0 black,*/
            /*2px 0 0 black,*/
            /*1px 0 0 black;*/
            overflow: hidden;
        }
        body {
            width: 720px;
            height: 770px;
            background-color: transparent;
            display: flex;
            flex-direction: column;
            overflow: hidden;
        }
        .pill {
            margin-left: auto;
            margin-right: auto;
            padding-left: 2rem;
            padding-right: 2rem;
            width: 90%;
            /*border-radius: 10px;*/
            border: black 1px solid;
            background-color: rgba(0,0,0,0.2);
            /*margin-top: 0.5rem;*/
            height: 4.3rem;
            display: flex;
            font-family: 'Alata', sans-serif;
            color:black;
            font-size:1.8rem;
            justify-content: space-between;
            line-height: 4.3rem;
        }
        .header{
            padding-left: 2rem;
            padding-right: 2rem;
            width: 80%;
            margin-left: auto;
            /*border-radius: 10px;*/
            /*background-color: #494C52;*/
            margin-top: 2rem;
            height: 4.3rem;
            display: flex;
            font-family: 'Alata', sans-serif;
            color:black;
            font-size:1.8rem;
            justify-content: space-between;
            line-height: 4.3rem;
        }
        .frameTop {
            top:9px;
            left:9px;
            position: absolute;
        }
        .frameBottom {
            transform: rotate(180deg);
            position: absolute;
            top:706px;
            left:655px;
        }
        .tab{
            display: flex;
            justify-content: space-between;
        }
        .rank {
            width: 60px;
            padding-right: 2rem;
        }
        .username{
            white-space: nowrap;
            overflow: hidden;
            text-overflow: ellipsis;
            max-width: 300px;
        }
        .xp{
            display: flex;
            text-wrap: none;
            font-weight: lighter;
            font-size: 1.8rem;
            right: 0;
        }
        /*.l-1{*/
        /*    color:gold;*/
        /*}*/
        /*.l-2{*/
        /*    color:silver;*/
        /*}*/
        /*.l-3{*/
        /*    color:darkorange;*/
        /*}*/
        .userimage{
            margin-right: 1rem;
            border-radius: 50px;
            padding-top: 2px;
            padding-bottom: 2px;
            height: auto;
            width: 4rem;
        }
    </style>
</head>
